using Microsoft.SqlServer.Types;

using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace IRI.Test.NetFrameworkTest.Common;


public class HexStringTest
{
    public HexStringTest()
    {
        SqlServerTypes.Utilities.LoadNativeAssembliesv14();
    }

    [Fact]
    public void TestByteArrayToHexConversion()
    {
        var azarbayejanString = "";

        var array = IRI.Sta.Common.Helpers.HexStringHelper.ToByteArray(azarbayejanString);

        var azarbayejan = SqlGeometry.STGeomFromWKB(new System.Data.SqlTypes.SqlBytes(array), 0);

        var stringValue = IRI.Sta.Common.Helpers.HexStringHelper.ByteToHexBitFiddle(array, true);

        Assert.Equal(azarbayejanString, stringValue);
         
    }
}
